// src/Popup.tsx

import React from "react";
import { render } from "react-dom";
import { ChromeExtensionPopup } from "Popupdom.tsx";

const Popup = () => {
  return (
    <ChromeExtensionPopup draggable>
      <div
        style={{
          width: "200px",
          height: "200px",
          backgroundColor: "lightblue",
        }}
      >
        <h1>Hello!</h1>
        <p>This is a draggable popup.</p>
      </div>
    </ChromeExtensionPopup>
  );
};

render(<Popup />, document.getElementById("root"));
